// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "./IERCO20.sol";

// class implements
contract ERC20 is IERC20 {
    // 우리의 토큰의 내용을 작성;
    
    // 토큰의 이름 풀네임 
    string public name;

    // 토큰의 심볼(토큰의 단위를 표현) ETH 등
    string public symbol;

    // 토큰의 소수점 자리 기본 18자리의 단위로 지정해준다.
    uint8 public decimals = 18;

    // 토큰의 총 발행량
    // 이미 선언되어 있는 메서드를 interface의 메서드 가상 함수로 되어있고 내용이 없다. 
    // override 상속 받은 가상함수를 상태변수로 정의 해서 사용 덮어쓰기
    uint public override totalSupply;

    // 완전 과거 버전의 ERC20 컨트랙트에는 상태변수로 포함이 되어있었는데 
    // owner 컨트랙트가 추가되면서
    address private owner;

    // 토큰의 량을 가지고 있을 상태 변수
    mapping(address => uint) public balances;
    /*
        {0x1 : 100}
     */

    // 토큰의 소유권을 위임받은 내용을 관리할 상태변수
    mapping(address => mapping(address => uint)) public override allowance;
    /*
        {
            0x1 : {
                    0x2 :10,
            }
        }
     */

    // 생성자 함수
    constructor(string memory _name, string memory _symbol, uint256 _amount){
        // 가스비 절감 memory 구문으로 
        // CA를 생성하는 단게에서 컨트랙트 배포 단계
        // 최초에 딱 한번 발생하는 생성자 함수를 실행시키는 사람은 무조건 컨트랙트 배포자이다. 
        owner = msg.sender;
        name = _name; // mmtoken
        symbol = _symbol;// STK
        // 촐발행 시킬것.
        // 토큰의 량 만큼 넣을건데
        // 소수점이 붙기 때문에 단위를 맞춰주자.
        // 10000 * 10 ** decimals
        mint(_amount * (10 ** decimals));
    }

    // 토큰을 발행하는 함수 
    function mint(uint amount) internal {
        balances[msg.sender] += amount;
        // 생성자 함수에 호출을 하면
        // 컨트랙트 배포자가 발행량 만큼을 발행
        // 상타변수에 업데이트 된다. 배포자의 계정에 발행한 수만큼 
        totalSupply += amount;
    }

    // 소유권 이전 메서드
    // 다른 지갑으로 소유권을 이전 해주는 메서드
    // 상태 데이터변경
    function transfer(address to, uint amount) external override returns(bool){
        // 검증식 이 사람이 돈이 있는지 확인을 하고
        // require(address(msg.sender).balance > amount);
        balances[msg.sender] -= amount;
        balances[to] += amount;
        // 트랜잭션 발생후 로그에 내용이 
        // 0 1 2
        // msg.sender, to, amount 순서대로 로그를 확인할 수 있다.
        emit Transfer(msg.sender, to, amount);

        return true;
    }

    // 누군가에게 소유권울 넘겨주는 메서드 
    function approve(address spender, uint amount) external override returns(bool){
        allowance[msg.sender][spender] = amount;
        emit Approval(msg.sender,spender,amount);
        return true;
    }

    // 소유권을 가지고 있는 계정이 토큰을 보내는 경우
    function transferFrom(address spender,address to,uint amount) external override returns(bool){
        // 소유권이 있는지 확인
        // msg.sender 호출한 사람 = 내가 누구에게 위임을 받았고 
        // 위임 받은 사람의 토큰을 다른 계정으로 보낸다.
        // spender == 0x1  의 지갑에서 받은 토큰을 보낸다.
        // 내가 0x1 계정에서 amount 보내는 량 만큼 위임을 받았는지 확인
        require(allowance[spender][msg.sender] >= amount);

        allowance[spender][msg.sender] -= amount;
        /*
            {
                0x1 : {
                    0x2 : 10000,
                }
            }
         */
        balances[spender] -= amount;
        balances[to] += amount;
        return true;
    }
    function balanceOf(address account) external view returns (uint) {
        return balances[account];
    }
}

IERCO20.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

// 지금 작성하는 코드는 내용을 파악하기 위해서 
// 이미 배포되어있는 표준 규칙의 코드를 가져와서 사용을 하기 때문에 
// 오픈제플린에서 사용만 하면 되지만 코드를 파악하고 사용해야한다. 

// 호환성과 보안 이슈등의 이유로 작성되어있는 규칙에 맞는 코드로 작업을 해야한다. 

interface IERC20 {
    // 총 토큰의 발행량을 조회 
    function totalSupply() external view returns(uint);

    // 해당 지갑이 가지고 있는 토큰의 량을 조회
    function balanceOf(address account) external view returns(uint);

    // 지갑에서 토큰을 다른 지갑으로 소유권 이전
    // 보내는 사람은 msg.sender => 받는 사람 to, 받는 량 amount 토큰의 량
    function transfer(address to, uint amount) external returns(bool);
    /*
    mapping(address => uint) soontoken;
    soontoken = {0x1, 10000}

    // 0x1 지갑이 transfer 실행을 했다. 
    // msg.sender == 0x1
    // 0x2 지갑에 토큰 50000개를 전달 매개변수로 담아서 
    soontoken = {0x2 : 50000};
    soontoken[0x1] = 50000;
    } 
    */ 

   // 소유권을 위임
    function approve(address spender, uint256 value) external returns (bool);
    /*
        mapping(address => mapping(address => uint)) allowanceToken
        allowanceToken = {
            0x1 : {
                0x2 : 0
            }
        }
    
    0x1 계정이 0x2 계정에게 10000개를 위임 받았다. 
    allowanceToken
    */

   // 얼마만큼 누가 위임을 받았는지
   function allowance(address owner, address spender) external returns(uint);
   

   // 소유권을 위임 받은 사람이 다른 지갑에게 토큰의 소유권을 이전할때
   function transferFrom(address spender,address to, uint amount) external returns (bool);
   // 소유권을 받았는지 확인
   // transfer()
   // 소유권 이전
   // 0x2이 계정이 받은 소유자와 본인이 위임 받은 잔액을 조회하고,
   // to의 계정에게 amount 만큼의 보낼 금액으로 상태변수 전환 


    // 이벤트 로그를 확인할 수 있다. 
    // log로 확인할 수 있다. 
   event Transfer(address from, address to, uint value);
   event Approval(address from, address spender, uint value);
   
}

